import React, { useState, useEffect } from 'react';

function App() {

  const [data, setData] = useState([{}])

  useEffect(()=> {
    fetch("/workout/all").then(
      res => res.json()
    ).then(
        data => {
          setData(data)
          console.log(data)
        }
    )
  }, [])

  return (
      <div>
          <h1>Workouts</h1> 
          {(typeof data.workout ==='undefined') ? (
            <p>Loading...</p>
          ) : (
            data.workout.map((workout, i) => (
              <p key={i}>{workout}</p>
            ))
          )}
      </div>
  );
}

export default App
